import React from "react"

export default function Home() {
    return (
        <div class="titleDes">
               <h2 class="t">Home</h2>
               <h2 class="r"><b>Oi!! Vamos viajar?</b></h2>
                <p class="h2">Planeje a melhor viagem da sua vida conosco</p><br/>
                <br /><br /><br /><br /><br />
                <br /><br /><br /><br /><br />               <br /><br /><br /><br /><br />
                <br /><br /><br /><br /><br />
                <p class="h2">Pacotes de Viagens para Diversos Locais com Preços Justos. Entre em Contato Agora</p>
                <br /><br /><br /><br /><br />
                <br /><br /><br /><br /><br />
        </div>
    );
}
